import React, { Component } from 'react';

class NavBar extends Component{

  render(){
    return(
      <div className="semantic ui vertical pointing menu">
      <a className="active item">
      Home
    </a>
    <a className="item">
      Settings
      </a>
      <a className="item">
      Sign Out
      </a>

      </div>
    )
  }
}

export default NavBar
